INSERT INTO `catpuestos` VALUES (1,'Encargad@ Cocina','Solicitud de empleo\r\nCopia de INE\r\nComprobante de Domicilio\r\nCURP\r\nComprobante de Ultimo grado de estudios.\r\n2 Cartas de recomendación.\r\nCertificado de Salud para Manipulación Alimentos y Bebidas vigente durante en tiempo que labore ( Renovar cada 6 meses )\r\nCurriculum Vitae.\r\nActa de Nacimiento','Encargado del área de Cocina.\r\nPlanificación, organización y control de las actividades del área de cocina y de todo su personal para lograr la seguridad, higiene y calidad del servicio que se ofrece.\r\nOrganiza la apertura y cierre del área\r\nOrganiza y distribuye las funciones y responsabilidades de los colaboradores de la cocina.\r\nElabora los turnos y horarios en función de la ocupación del Restaurant del área de cocina.\r\nEstablece días libres, vacaciones y vigila el horario de entrada y salida del personal.\r\nTrabaja permanentemente en las mejoras del servicio de su área aportando sus ideas y solicitando cooperación de los colaboradores de la cocina\r\nMantiene reuniones periódicas con los colaboradores de cocina para fomentar su participación, dar a conocer resultados e informar sobre cambios y aspectos importantes del Restaurant.\r\nCoopera con el área del comedor para conseguir que el servicio de comidas sea correcto y no se produzca ninguna incidencia.\r\nVigila el consumo racional de las materias primas para obtener el máximo rendimiento y durante el servicio controla que los platos solicitados salgan en las condiciones exigidas.\r\nSupervisa que todas las labores del área se realicen de acuerdo a los procedimientos y estándares de calidad establecidos.\r\nSupervisa la higiene, diligencia, disciplina, eficacia y eficiencia en el área de cocina.\r\nDiseña platos y participa en su elaboración.\r\nLleva una estadística de los platos con mayor y menor aceptación por parte de clientes.\r\nRealiza valoraciones periódicas de su personal y las propone por escrito al gerente para promociones, sanciones o despidos.\r\nPromueve la formación de los colaboradores de la cocina.\r\nRealiza labores de formación continua para mejorar constantemente el nivel  de profesionalización del área de cocina.\r\nComprobar la correcta presentación de los platos tanto al inicio del servicio como durante la realización del mismo.\r\nMinimización de las pérdidas y roturas de material y control del stock del mismo.\r\nControla el nivel de existencias.\r\nOrganiza y supervisa la realización de inventarios.\r\nCuando se daña algo en el área de cocina decide si fue por tiempo de vida, por descuido o daño intencionado y en su caso a quien o quienes se les aplicará una sanción.\r\nPrograma los menús diarios o estacionales\r\nEvita en lo posible el gasto excesivo de la electricidad, agua, gas, etc.\r\nCumple con todos los checklist y registros correspondientes y estar al pendiente de los asignados al resto del área.\r\nToma las decisiones que sean necesarias para corregir problemas y poder sacar el mayor provecho a los recursos materiales y humanos.\r\nDebe mantener un clima laboral satisfactorio y el trabajo en equipo.\r\nVela por el correcto cumplimiento de las normas y el reglamento interior de trabajo en su área. \r\nCuando quiera implantar cambios de mejora en el funcionamiento de su área se hará de forma progresiva evitando haciendo un seguimiento de los resultados y tomando en cuenta el tiempo de adaptación.\r\nEvitar las distorsiones de mensajes al pasar de un nivel a otro en la escala jerárquica y adaptará la forma de comunicar los mensajes a cada receptor evitando las malas interpretaciones por problemas de lenguaje o canal de comunicación.\r\nEntrena a los aprendices.','Habilidades para establecer relaciones interpersonales, captar instrucciones orales y escritas, calcular raciones o cantidades para preparar alimentos.\r\nDestrezas en Manejo y mantenimiento de utensilios de cocina, manipulación de alimentos.','Conocimientos en Nutrición y dietética, Conservación de alimentos, normas de higiene y seguridad.\r\nAdiestramiento Básico de Cocina, Higiene y Seguridad, Relaciones Humanas.','EVENTUAL',1,2),(2,'Cocinero Línea Caliente','','Cumple con la normatividad específica del área y las normas de seguridad e higiene.\r\nCumple con los registros y cheklist del área que es responsable.\r\nParticipa en las reuniones del área.\r\nParticipa en los cursos de formación que se organicen.\r\nAsume la responsabilidad del área en la que trabaja.\r\nControla y cuida la conservación y aprovechamiento de los productos puestos a su disposición.\r\nColabora en la planificación de menús y cartas.\r\nColabora en la gestión de inventarios y compras.\r\nRevisa y controla el material de uso en la cocina, comunicando cualquier incidencia al respecto.\r\nColabora en los pedidos y conservación de materias primas y productos de uso en la cocina.\r\nRealiza de manera cualificada, autónoma y responsable la preparación, aderezo y presentación de platos utilizando las técnicas más idóneas.\r\nEs encargado de elaboración de platillos, salsas, guarniciones y de todo producto caliente  existente en el menú, así mismo del menú de empleados.\r\nElaboración de postres que requieran ser horneados, así como de conocer a perfección el menú completo y a su vez  montaje, elaboración y producción  de la línea fría en caso de ser requerido en el área.\r\nTiene la obligación de limpiar y desinfectar su área así como todo utensilio y/o equipo de la cocina que vaya a utilizar.\r\nInformar al sous chef al todas las novedades que sucedieron durante su turno así como un reporte de mermas y bajas de producto y dar de manera escrita el pedido general que incluye el de todas las áreas tanto de cocina fría así como productos de limpieza y desinfección. \r\nEstá obligado a cerrar todas las válvulas de gas al finalizar su turno en caso de ser el cocinero del turno mixto.\r\nMantener una mise-en-place. \r\nPrepara condimentos y especies según se requiera.','','','EVENTUAL',2,2),(3,'Stewart','','Cumple con la normatividad específica del área y las normas de seguridad e higiene.\r\nCumple con los registros y cheklist del área que es responsable.\r\nParticipa en las reuniones del área.\r\nParticipa en los cursos de formación que se organicen.\r\nAsume la responsabilidad del área en la que trabaja.\r\nControla y cuida la conservación y aprovechamiento de los productos puestos a su disposición.\r\nColabora en la planificación de menús y cartas.\r\nColabora en la gestión de inventarios y compras.\r\nRevisa y controla el material de uso en la cocina, comunicando cualquier incidencia al respecto.\r\nColabora en los pedidos y conservación de materias primas y productos de uso en la cocina.\r\nRealiza de manera cualificada, autónoma y responsable la preparación, aderezo y presentación de platos utilizando las técnicas más idóneas.\r\nEs encargado de elaboración de platillos, salsas, guarniciones y de todo producto caliente  existente en el menú, así mismo del menú de empleados.\r\nElaboración de postres que requieran ser horneados, así como de conocer a perfección el menú completo y a su vez  montaje, elaboración y producción  de la línea fría en caso de ser requerido en el área.\r\nTiene la obligación de limpiar y desinfectar su área así como todo utensilio y/o equipo de la cocina que vaya a utilizar.\r\nInformar al sous chef al todas las novedades que sucedieron durante su turno así como un reporte de mermas y bajas de producto y dar de manera escrita el pedido general que incluye el de todas las áreas tanto de cocina fría así como productos de limpieza y desinfección. \r\nEstá obligado a cerrar todas las válvulas de gas al finalizar su turno en caso de ser el cocinero del turno mixto.\r\nMantener una mise-en-place. \r\nPrepara condimentos y especies según se requiera.','','','EVENTUAL',2,2),(4,'2do Encargad@ Cocina','','Cumple con la normatividad específica del área y las normas de seguridad e higiene.\r\nCumple con los registros y cheklist del área que es responsable.\r\nParticipa en las reuniones del área.\r\nParticipa en los cursos de formación que se organicen.\r\nAsume la responsabilidad del área en la que trabaja.\r\nControla y cuida la conservación y aprovechamiento de los productos puestos a su disposición.\r\nColabora en la planificación de menús y cartas.\r\nColabora en la gestión de inventarios y compras.\r\nRevisa y controla el material de uso en la cocina, comunicando cualquier incidencia al respecto.\r\nColabora en los pedidos y conservación de materias primas y productos de uso en la cocina.\r\nRealiza de manera cualificada, autónoma y responsable la preparación, aderezo y presentación de platos utilizando las técnicas más idóneas.\r\nEs encargado de elaboración de platillos, salsas, guarniciones y de todo producto caliente  existente en el menú, así mismo del menú de empleados.\r\nElaboración de postres que requieran ser horneados, así como de conocer a perfección el menú completo y a su vez  montaje, elaboración y producción  de la línea fría en caso de ser requerido en el área.\r\nTiene la obligación de limpiar y desinfectar su área así como todo utensilio y/o equipo de la cocina que vaya a utilizar.\r\nInformar al sous chef al todas las novedades que sucedieron durante su turno así como un reporte de mermas y bajas de producto y dar de manera escrita el pedido general que incluye el de todas las áreas tanto de cocina fría así como productos de limpieza y desinfección. \r\nEstá obligado a cerrar todas las válvulas de gas al finalizar su turno en caso de ser el cocinero del turno mixto.\r\nMantener una mise-en-place. \r\nPrepara condimentos y especies según se requiera.','','','EVENTUAL',1,2),(5,'Cocinero Línea Fría','Destrezas en: Manejo y mantenimiento de utensilios de cocina, manipulación de alimentos.\r\nAdiestramiento Requerido: Básico de Cocina, Higiene y Seguridad, Relaciones Humanas.','Cocina platos sencillos de acuerdo al menú solicitado.\r\nHornea y fríe alimentos requeridos en el menú\r\nLimpia frutas, verduras, hortalizas, aves, carnes y pescados para su preparación.\r\nOrdena los utensilios de cocina.\r\nAsea las mesas, mesones, estantes, baldosas, pisos, fregaderos y demás áreas manteniendo un perfecto estado de limpieza.\r\nLava, seca, esteriliza y organiza estantes, utensilios e implementos de cocina.\r\nRecopila y elimina los desperdicios de alimentos en la cocina y comedores.\r\nMantiene limpio y en orden los equipos y el sitio de trabajo.\r\nCumple con las normas de seguridad establecidas en la empresa.\r\nRealiza cualquier otra tarea afín que le sea asignada.','Habilidades para: Establecer relaciones interpersonales, captar instrucciones orales y escritas, calcular raciones o cantidades para preparar alimentos.\r\n','Conocimientos en: Nutrición y dietética, Conservación de alimentos, normas de higiene y seguridad.','EVENTUAL',2,2),(6,'Mesero','','Conoce el uso del material y equipo de barra.\r\nSe encarga de la limpieza de mesas, estaciones de servicio, ceniceros, charolas, lámparas de mesa.\r\nEs responsable del montaje de las mesas.\r\nEs responsable de tener surtidas las estaciones de servicio.\r\nAyuda al acomodo de los clientes en las mesas.\r\nConoce el manejo correcto de la cristalería.\r\nConoce los ingredientes y la preparación de bebidas.\r\nSugiere al cliente aperitivos, cócteles, y demás bebidas.\r\nConoce y aplica el sistema para escribir órdenes.\r\nPresenta al cliente la lista de bebidas, comidas y lo asiste en la elección.\r\nToma órdenes de bebidas, comidas etc.\r\nSirve las bebidas y comidas a la mesa.\r\nReemplaza ceniceros.\r\nRecoge vasos y copas sucias.\r\nSolicita las cuentas al cajero, y las presenta al cliente.\r\nPaga al cajero la cuenta y despide al cliente.','Ser cortes y de buenos modales, con espíritu de servicio simpatía y personalidad.','Conocer los conceptos básicos de servicio a clientes, como: servicio de comedor y bar, conocimientos básicos de gastronomía, conocimiento Básico de bebidas y cafés.','EVENTUAL',4,1),(7,'Cajero','','Supervisa funciones de los meseros y baristas.\r\nEs el encargado de recibir a los clientes y de asignarles su mesa.\r\nEs quién toma la primera orden de los clientes.\r\nDomina toda la carta de bebidas y comida.\r\nSolicita al encargado de compras equipo y suministros faltantes.\r\nAutoriza las cuentas que se enviaron para su cobro.\r\nSupervisa el Servicio general.\r\nSupervisa el Aseo en la preparación.\r\nSupervisa el Porcionamiento.','','Adiestramiento Requerido: Básico de Cocina, Higiene y Seguridad, Relaciones Humanas.\r\nConocimientos en: Normas de higiene y seguridad.','BASE',2,1),(8,'Barista','','','','','EVENTUAL',2,1),(9,'Gerente','','','','','BASE',1,3),(10,'Cajero','','','','','EVENTUAL',1,1);
